import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './Kayit.css'; // CSS dosyasını içe aktarıyoruz

const Kayit = ({ onSelectLanguage }) => {
  const [currentLanguage, setCurrentLanguage] = useState('Choose your language');
  const languages = [
    'Choose your language',
    'Выберите ваш язык',
    'Dil Seçiniz',
    'Choisissez votre langue',
    'اختر لغتك'
  ];
  let languageIndex = 0;
  const navigate = useNavigate();

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentLanguage(languages[languageIndex]);
      languageIndex = (languageIndex + 1) % languages.length;
    }, 300);

    return () => clearInterval(interval);
  }, []);

  const handleLanguageSelect = (language) => {
    onSelectLanguage();
    navigate('/main', { state: { language } });
  };

  return (
    <div className="KayT">
      <div className="Group1261152996">
        <div className="vector1"></div>
        <div className="vector2"></div>
        <div className="vector3"></div>
        <div className="vector4"></div>
        <div className="Vector12"></div>
      </div>
      <div className="Frame1261153063">
        <div className="DilSeIniz">Dil Seçiniz</div>
        <div className="Frame1261153061">
          <div className="FrameInner">
            <button className="Frame26" onClick={() => handleLanguageSelect('Türkçe')}>
              <div className="TRkE">Türkçe</div>
            </button>
            <button className="Frame26" onClick={() => handleLanguageSelect('English')}>
              <div className="TRkE">English</div>
            </button>
            <button className="Frame26" onClick={() => handleLanguageSelect('فارسي')}>
              <div className="TRkE">فارسي</div>
            </button>
            <button className="Frame26" onClick={() => handleLanguageSelect('Français')}>
              <div className="TRkE">Français</div>
            </button>
            <button className="Frame26" onClick={() => handleLanguageSelect('русский')}>
              <div className="TRkE">русский</div>
            </button>
          </div>
        </div>
      </div>
      <div className="TasksBar"></div>
      <div className="Frame1261153050">
        <div className="Tech">Tech</div>
        <div className="Frame1261153049">
          <div className="Group13">
            <div className="vectorSmall vectorSmall1"></div>
            <div className="vectorSmall vectorSmall2"></div>
            <div className="vectorSmall vectorSmall3"></div>
            <div className="vectorSmall vectorSmall4"></div>
            <div className="vectorSmall vectorSmall5"></div>
            <div className="vectorSmall vectorSmall6"></div>
            <div className="vectorSmall vectorSmall7"></div>
            <div className="vectorSmall vectorSmall8"></div>
            <div className="vectorSmall vectorSmall9"></div>
            <div className="vectorSmall vectorSmall10"></div>
          </div>
          <div className="vectorLarge"></div>
        </div>
        <div className="BRr">BRr</div>
      </div>
    </div>
  );
};

export default Kayit;
